INSERT INTO `spu` VALUES ('jjjjjjjj', '哈哈奶茶', 'https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/WEEmSRizTQbTEC8n.jpg', '[\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/ckjeXGhzwFtCrQFj.png\",\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/ckjeXGhzwFtCrQFj.png\"]', '[{\"name\":\"dd\",\"options\":[\"dd\",\"ff\"]}]', 'custom', NULL, '哈哈奶茶\n哈哈奶茶\n哈哈奶茶', '[\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/4PjKWks4ezfYXcCQ.jpg\"]', '[{\"name\":\"品种\",\"values\":[\"cc\",\"xx\"]}]', 1, '20210312144535664', NULL, '2021-03-17 10:45:14', '2021-03-18 17:07:56');
INSERT INTO `spu` VALUES ('yt_donghuapian', '哪吒', 'https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/a6mW58WPSmFC54AR.jfif', '[\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/3YKSTASziQFWdW4S.png\"]', '[{\"name\":\"糖度\",\"options\":[\"十分\",\"五分\",\"三分\",\"无糖\"]},{\"name\":\"温度\",\"options\":[\"常温\",\"加冰\",\"加热\"]}]', 'custom', NULL, '主要记载源于元代宗教神话典籍《三教搜神大全》，活跃于明代神魔系列小说名著《封神演义》、《西游记》、《南游记》等多部古典文学作品。托塔李天王家的三太子，最早传说来自古波斯和古印度教的神话，随着本土化的传教，唐末起就从古盛传至今，由佛教护法军神“那咤”演变而成 [2]  ，记载早已在东晋朝代有之。\n主要定型于闹海屠龙的传说，以及降魔伏妖再成仙入圣等故事内容，出生奇异，一身神器，能变化三头六臂又或三头八臂；百邪不侵、免疫病毒瘟疫、专克摄魂夺魄的莲花化身。在中国各地成为世代相传、家喻户晓的著名艺术形象；后期影响民', '[\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/7C5KfQJ3nJ5wCp44.jpg\",\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/57ncHsAsph3mxsWG.jpg\",\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/MM7BjHZGH7BHB3ca.jpg\"]', '[{\"name\":\"包装\",\"values\":[\"哪吒\"]}]', 1, '20210324144820190', NULL, '2021-03-24 15:07:05', '2021-03-24 15:07:05');
INSERT INTO `spu` VALUES ('yt_dong_qiu', '一个像秋天', 'https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/eFwSTrSMFmH2KNye.jpg', '[\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/Smxb4CRr8miZDc2W.jpg\",\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/nHZE6xiXbTjjjZKe.jpg\"]', '[{\"name\":\"冰\",\"options\":[\"1冰\",\"2冰\",\"3冰\",\"4冰\",\"5冰冰冰冰冰\",\"6冰冰冰冰冰冰冰\"]},{\"name\":\"火\",\"options\":[\"1活\",\"2火火\",\"3火火火\",\"4火火火火\",\"5嚯嚯嚯嚯嚯\",\"6哈哈哈哈哈哈哈哈哈\"]}]', 'custom', NULL, '如果不是你\n范玮琪\n范玮琪\n我不会相信\n朋友比情人还死心塌地\n就算我忙恋爱\n把你冷冻结冰\n你也不会恨我\n只是骂我几句\n如果不是你\n我不会确定\n朋友比情人更懂得倾听\n我的弦外之音\n我的有口无心\n我离不开darling更离不开你\n你了解我所有得意的东西\n才常泼我冷水怕我忘形\n你知道我所有丢脸的事情\n却为我的美好形象保密\n如果不是你\n我不会相信\n朋友比情人还死心塌地\n就算我忙恋爱\n把你冷冻结冰\n你也不会恨我\n只是骂我几句\n如果不是你\n我不会确定\n朋友比情人更懂得倾听\n我的弦外之音\n我的有口无心\n我离不开darl', '[\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/Tk5rzzZCwe84TdkT.jpg\",\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/NaYYNfyKbYzZkiH2.jpg\",\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/pWXtCFsRTXfNjEB6.jpg\",\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/5sSQ8wPJArcK7d3H.jpg\"]', '[{\"name\":\"品种\",\"values\":[\"冬天\",\"秋天\"]}]', 1, '20210324110953376', NULL, '2021-03-24 11:40:35', '2021-03-24 11:40:35');
INSERT INTO `spu` VALUES ('yt_xiatian', '一个像夏天一个像春天', 'https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/s6A6FXBbJaCsR7kF.jpg', '[\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/GZJcCkwZt8cEYb5F.jpg\",\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/63hDxjXejBRWA6e5.jpg\"]', '[{\"name\":\"糖度\",\"options\":[\"唐嫣\",\"溏心\",\"糖糖\",\"没糖\"]},{\"name\":\"温度\",\"options\":[\"常温\",\"加冰\",\"多多冰\",\"少少冰\",\"多冰冰\",\"少冰冰\",\"范冰冰\",\"李冰冰\"]}]', 'custom', NULL, '第一次见面看你不太顺眼\n谁知道后来关系那么密切\n我们一个像夏天一个像秋天\n却总能把冬天变成了春天\n你拖我离开一场爱的风雪\n我背你逃出一次梦的断裂\n遇见一个人然后生命全改变\n原来不是恋爱才有的情节\n如果不是你\n《一个像夏天一个像秋天》曲谱\n《一个像夏天一个像秋天》曲谱\n我不会相信\n朋友比情人还死心塌地\n就算我忙恋爱\n把你冷冻结冰\n你也不会恨我\n只是骂我几句\n如果不是你\n我不会确定\n朋友比情人更懂得倾听\n我的弦外之音\n我的有口无心\n我离不开darling更离不开你\n你拖我离开一场爱的风雪\n我背你逃出一次梦的断', '[\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/bzkS4sPTBPdJkHZP.jpg\",\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/5rkpnhKRrxFas5wJ.jpg\",\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/QXkAa66GpYiR6XzA.jpg\",\"https://mas-int.oss-cn-hangzhou.aliyuncs.com/test72/mas/mbJefwttsSXci8hk.jpg\"]', '[{\"name\":\"口味\",\"values\":[\"加奶\",\"加夏天\"]}]', 1, '20210324110953376', NULL, '2021-03-24 11:40:35', '2021-03-24 11:40:35');
